package main
import "fmt"

func kWeakestRows(mat [][]int,k int) []int {
    cols := len(mat[0])
    //fmt.Println(cols)
    arr := make([][]int,cols+1)
    //fmt.Println(arr)
    for r,v := range mat {
        cnt := 0
        for _,w := range v {
            if w == 1 {
                cnt++
            }
        }
        //fmt.Println(r,v,cnt)
        arr[cnt] = append(arr[cnt],r)
    }
    //fmt.Println(arr)
    var res []int
    for _,v := range arr {
        if len(v) > 0 {
            for _,w := range v {
                res = append(res,w)
                k--
                if k <= 0 {
                    return res
                }
            }
        }
    }
    return res //No way to avoid this return in Golang? Control will never reach here, as per problem constraints!
}

